import React from 'react'
import Pics from './Pics'
import ('./PicsNNews.css')

export default class PicsNNews extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      pic: picOne
    }
  }
  componentDidMount() {
    const pics = [
      picOne,
      picTwo,
      picThree,
      picFour,
      vidOne,
      vidTwo,
      vidThree
    ]
    const picChooser = setInterval(() => {
      this.setState({
        pic: pics[Math.floor(Math.random() * pics.length)]
      })
    }, 10000)
  }
  render() {
    return(
      <div className="picsNNews">
        <Pics />
        <div className="News">
        </div>
      </div>
    )
  }
}
